import './exploreProfile.css'
import Axios from 'axios';

export default function ExploreProfile({sgUser}) {
    return (
        <div className='explore-profile'>
                <img className="profile-img" src={process.env.REACT_APP_PULIC_FOLDER + "/default_avatar.jpg"} alt="" />

            <div className="name-info">
                <div className="name">{sgUser.username}</div>
                <div className="info">New to Instagra</div>
            </div>
        </div>
    )
}
